";}";s:17:"__wpdm_freeaddons";s:64892:"{"post":[{"ID":58950,"post_author":"1","post_date":"2017-06-11 13:18:12","post_date_gmt":"2017-06-11 13:18:12","post_content":"WP-Filebase Data Importer for WordPress Download Manager. You asked for this and here it is now :)\r\n\r\nPlease follow the steps to import data:\r\n<ol>\r\n \t<li>Install &amp; activate Wordpress Download Manager<\/li>\r\n \t<li>Install &amp; activate this addon<\/li>\r\n \t<li>please go to Admin Menu &gt;&gt; Download &gt;&gt; Settings &gt;&gt; Filebase Import:\r\n<img class=\"alignnone size-large wp-image-58951\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2017\/06\/filebase-import-settings-1024x795.png\" alt=\"filebase import settings\" width=\"960\" height=\"745\" \/><\/li>\r\n \t<li>Check the files you want to import<\/li>\r\n \t<li>Click \"Save Setting\"<\/li>\r\n \t<li>Done<\/li>\r\n<\/ol>","post_title":"WP-Filebase Data Importer","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wp-filebase-data-importer","to_ping":"","pinged":"","post_modified":"2017-06-11 13:18:12","post_modified_gmt":"2017-06-11 13:18:12","post_content_filtered":"","post_parent":0,"guid":"https:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=58950","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"2","filter":"raw"},{"ID":27148,"post_author":"1","post_date":"2015-03-15 10:15:39","post_date_gmt":"2015-03-15 10:15:39","post_content":"Box offers\u00a0up to 10 GB free cloud storage and file sharing services that enables you to securely share and access files online. Now you can use the space to store your download manager file. Using this add-on you can explore files in Box storage and attach them with Download Manager.","post_title":"Box.com Explorer","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"box-com-explorer","to_ping":"","pinged":"","post_modified":"2017-02-03 15:01:37","post_modified_gmt":"2017-02-03 15:01:37","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=27148","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"0","filter":"raw"},{"ID":26131,"post_author":"1","post_date":"2015-02-16 17:25:33","post_date_gmt":"2015-02-16 17:25:33","post_content":"DropBox Explorer add-on will add a new button with your Download Manager to explore files in dropbox and attach with your download manager package.\r\n\r\n<strong>Usage:<\/strong>\r\n\r\n<a href=\"http:\/\/www.wpdownloadmanager.com\/how-to-use-dropbox-to-store-files-and-allow-users-to-download-then-from-your-website\/\" target=\"_blank\" rel=\"noopener noreferrer\">How to use Dropbox to store your files and allow users to download them from your website<\/a>","post_title":"DropBox Explorer","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"dropbox-explorer","to_ping":"","pinged":"","post_modified":"2017-04-27 12:17:04","post_modified_gmt":"2017-04-27 12:17:04","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=26131","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"8","filter":"raw"},{"ID":25300,"post_author":"1","post_date":"2015-01-26 19:26:14","post_date_gmt":"2015-01-26 19:26:14","post_content":"Google Drive Explorer Add-on helps you to connect with Google Drive, you can explore your Google drive files, upload files to Google drive and attach with your package. You can control your Google drive directly from you site admin panel, use free 15 GB space and save your bandwidth.\r\n\r\nSetting Up Google Drive Explorer Add-on:\r\n<ol>\r\n \t<li>Visit <strong><a href=\"https:\/\/console.developers.google.com\/projectcreate\" target=\"_blank\" rel=\"noopener\">Google API Console<\/a><\/strong>, Create New Project:\r\n<img class=\"thumbnail alignnone wp-image-61671 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/New-Google-API-Project-1024x328.png\" alt=\"New Google API Project\" width=\"960\" height=\"308\" \/><\/li>\r\n \t<li>After hit create button, the next page you will see:\r\n<img class=\"thumbnail alignnone wp-image-61672 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Select-Google-API-Project-1024x404.png\" alt=\"Select Google API Project\" width=\"960\" height=\"379\" \/><\/li>\r\n \t<li>Now, click on \"Select a project\" or blue \"Select\" button to select your project from that page:\r\n<img class=\"alignnone wp-image-61673 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Select-Project-Popup-1024x951.png\" alt=\"Select Project Popup\" width=\"960\" height=\"892\" \/><\/li>\r\n \t<li>After selecting project you will see the following page, then click on \"Go to API overview\":\r\n<img class=\"alignnone size-large wp-image-61674\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Google-API-overview-1024x776.png\" alt=\"Google API overview\" width=\"960\" height=\"728\" \/><\/li>\r\n \t<li>At this step, you will see the following page, click on \"ENABLE APIS AND SERVICES\":\r\n<img class=\"alignnone size-large wp-image-61675\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/ENABLE-APIS-AND-SERVICES-1024x323.png\" alt=\"ENABLE APIS AND SERVICES\" width=\"960\" height=\"303\" \/><\/li>\r\n \t<li>From the following page, search for <strong>Google Drive API<\/strong> and <strong>Google Picker API<\/strong>, enable both:\r\n<img class=\"alignnone size-large wp-image-61676\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Enable-Google-API-1024x596.png\" alt=\"Enable Google API\" width=\"960\" height=\"559\" \/>\r\n<ol>\r\n \t<li>Search \"Google Picker API\"\r\n<img class=\"alignnone size-large wp-image-61677\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Search-Google-Picker-API-1024x404.png\" alt=\"Search Google Picker API\" width=\"960\" height=\"379\" \/><\/li>\r\n \t<li>Enable API:\r\n<img class=\"alignnone size-large wp-image-61678\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/API-Details-1024x311.png\" alt=\"API Details\" width=\"960\" height=\"292\" \/><\/li>\r\n \t<li>Select and enable \"Google Drive API\" in that same way.<\/li>\r\n<\/ol>\r\n<\/li>\r\n \t<li>After enabling both API your dashboard will look like:\r\n<img class=\"thumbnail alignnone wp-image-61679 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/API-Dashboard-1024x474.png\" alt=\"API Dashboard\" width=\"960\" height=\"444\" \/><\/li>\r\n \t<li>Setup consent screen:\r\n<img class=\"thumbnail alignnone wp-image-61682 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Setup-Consent-Screen-1024x845.png\" alt=\"Setup Consent Screen\" width=\"960\" height=\"792\" \/><\/li>\r\n \t<li>To set up API access credentials go to \"Credentials\" menu:\r\n<img class=\"thumbnail alignnone wp-image-61683 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/set-up-API-access-credentials-1024x759.png\" alt=\"setup API access credentials\" width=\"960\" height=\"712\" \/><\/li>\r\n \t<li>Click on \"OAuth client ID\" button to create new client id:\r\n<img class=\"thumbnail alignnone wp-image-61684 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Create-OAuth-client-ID-1024x750.png\" alt=\"Create OAuth client ID\" width=\"960\" height=\"703\" \/>\r\nRedirect URI should be like <strong>http:\/\/your-site.com\/wp-admin\/?page=wpdm-google-drive<\/strong> and set your site URL for \"Authorized JavaScript origins\", however, you can copy the URL from download manager Settings Page &gt;&gt; Cloud Storage &gt;&gt; Google Drive API Credential Settings Panel:\r\n<img class=\"thumbnail alignnone wp-image-61685 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Copy-Redirect-URL-From-Google-Drive-API-Credential-Settings-Panel-1024x663.png\" alt=\"Copy Redirect URL From Google Drive API Credential Settings Panel\" width=\"960\" height=\"622\" \/><\/li>\r\n \t<li>Create API access key:\r\n<img class=\"thumbnail alignnone wp-image-61686 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Create-API-access-key-1024x498.png\" alt=\"Create API access key\" width=\"960\" height=\"467\" \/><\/li>\r\n \t<li>Now get Client ID, Client Secret &amp; API Key from credential menu:\r\n<img class=\"thumbnail alignnone wp-image-61687 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Copy-Client-ID-Client-Secret-and-API-Key-1024x320.png\" alt=\"Copy Client ID Client Secret and API Key\" width=\"960\" height=\"300\" \/><\/li>\r\n \t<li>Use that info in Downloads Manager Settings Page &gt;&gt; Cloud Storage &gt;&gt; Google Drive API Credential Settings Panel:\r\n<img class=\"thumbnail alignnone wp-image-61688 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/Setup-Google-Drive-API-Credential-Settings-Panel-1024x816.png\" alt=\"Setup Google Drive API Credential Settings Panel\" width=\"960\" height=\"765\" \/><\/li>\r\n \t<li>And Save Settings!<\/li>\r\n \t<li>Now to Admin Menu &gt;&gt; Downloads &gt;&gt; Add New Package window and there you will see a new button \"Google Drive\" with \"Attach File\" metabox:\r\n<img class=\"thumbnail alignnone wp-image-25315 size-full\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2015\/01\/google-drive-button.png\" alt=\"google-drive-button\" width=\"603\" height=\"802\" \/><\/li>\r\n \t<li>Click on the button, you will see the following popup and click on \"Login to Google Drive\":\r\n<img class=\"thumbnail alignnone\" src=\"https:\/\/www.evernote.com\/l\/AV3Rn70hZhJGAoyEYFzHmcx2lK1P7szAJhsB\/image.png\" alt=\"Google Drive Picker\" width=\"2256\" height=\"1424\" \/><\/li>\r\n \t<li>After login and allow access, you will see the list of files from your Google drive.<\/li>\r\n \t<li>Finally attached files should be public to be downloadable:\r\n<img class=\"thumbnail alignnone\" src=\"https:\/\/www.evernote.com\/l\/AV2plSStoVhHzbt4XHmQBgm2QZfZhpnBD_4B\/image.png\" alt=\"Public\" width=\"1570\" height=\"964\" \/><\/li>\r\n<\/ol>\r\n&nbsp;","post_title":"Google Drive Explorer","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"google-drive-explorer","to_ping":"","pinged":"","post_modified":"2017-08-13 09:22:45","post_modified_gmt":"2017-08-13 09:22:45","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=25300","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"32","filter":"raw"},{"ID":24090,"post_author":"1","post_date":"2014-12-29 20:06:40","post_date_gmt":"2014-12-29 20:06:40","post_content":"Using WP Download Manager App you can check download stats, sales stats and some other wpdm admin option easily from your iPhone or iPad. Please install WPDM API add-on where you have installed WP Download Manager. The API add-on will enable remote access to your WP Download Manager data from this app securely.\r\n\r\n<strong>Features:<\/strong>\r\n<ul>\r\n \t<li>Check Packages &amp; Categories<\/li>\r\n \t<li>Check Sales Report ( If you are using premium package add-on)<\/li>\r\n \t<li>Check Download Stats<\/li>\r\n \t<li>Receive push notification on each sale<\/li>\r\n \t<li>Receive push notification when someone downloads<\/li>\r\n<\/ul>","post_title":"WPDM for iOS","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"wpdm-ios","to_ping":"","pinged":"","post_modified":"2016-12-24 07:23:20","post_modified_gmt":"2016-12-24 07:23:20","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=24090","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"0","filter":"raw"},{"ID":22597,"post_author":"1","post_date":"2014-11-16 19:13:21","post_date_gmt":"2014-11-16 19:13:21","post_content":"Advanced Sales Report helps you to keep track on sales in your digital store, you can generate various report on sales, compare sales on different months, weeks or days. If you are using <a href=\"http:\/\/www.wpdownloadmanager.com\/download\/premium-package\/\">Premium Package Add-on <\/a> , Advanced sale report is the much have add-on for you, simply download and install, It is FREE!\r\n<img class=\"alignnone size-full wp-image-22598\" src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2014\/11\/wpdmpp-sales-report.png\" alt=\"wpdmpp-sales-report\" width=\"995\" height=\"2193\" \/>","post_title":"Advanced Sales Report","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"advanced-sales-report","to_ping":"","pinged":"","post_modified":"2017-02-02 09:15:50","post_modified_gmt":"2017-02-02 09:15:50","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=22597","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"0","filter":"raw"},{"ID":21693,"post_author":"1","post_date":"2014-10-17 17:23:10","post_date_gmt":"2014-10-17 17:23:10","post_content":"Using WordPress Download Manager App you can check download stats, sales stats and some other wpdm admin option easily from your android device. Please install <strong><a href=\"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-api\/\">WPDM API<\/a><\/strong> add-on where you have installed WordPress Download Manager Pro. The API add-on will enable remote access to your wpdm data from android app securely.\r\n<strong>Usage:<\/strong>\r\n<ol>\r\n \t<li>Install &amp; activate <strong><a href=\"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-api\/\">WPDM API<\/a><\/strong> add-on<\/li>\r\n \t<li>Go to Admin Menu &gt;&gt; Downloads &gt;&gt; Settings &gt;&gt; Generate Api Key &gt;&gt; Save Settings\r\n<img class=\"alignnone size-full wp-image-52025\" src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2014\/10\/wordpress-download-manager-api-settings.png\" alt=\"\" width=\"1416\" height=\"1034\" \/><\/li>\r\n \t<li>Install the Android App from play store\r\n<img class=\"thumbnail\" src=\"http:\/\/chart.apis.google.com\/chart?chs=200x200&amp;cht=qr&amp;chld=|1&amp;chl=http%3A%2F%2Fgoo.gl%2FQcD1gI\" alt=\"Scan\" \/><\/li>\r\n \t<li>Go to App Menu &gt;&gt; Connect New Site<\/li>\r\n \t<li>Enter your site url and api key or scan the QR code from step #2<\/li>\r\n \t<li>Done &amp; Enjoy!<\/li>\r\n<\/ol>\r\n<strong>\u00a0<\/strong>","post_title":"WPDM for Android","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"wpdm-android","to_ping":"","pinged":"","post_modified":"2016-12-20 09:33:43","post_modified_gmt":"2016-12-20 09:33:43","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=21693","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"4","filter":"raw"},{"ID":21691,"post_author":"1","post_date":"2014-10-17 17:05:59","post_date_gmt":"2014-10-17 17:05:59","post_content":"You can use this add-on to handle remote data access request in your Download Manager Installation. <a href=\"http:\/\/www.wpdownloadmanager.com\/download\/premium-package-wordpress-digital-store-solution\/\" target=\"_blank\">Premium Package \u2013 WordPress Digital Store Solution<\/a> is required with WPDM for this add-on.\r\n\r\n<strong>API URL:<\/strong>\r\n<pre>http:\/\/wp-site-url\/?wpdm_api=API_KEY&amp;task=API_Call_Fn&amp;parameters....<\/pre>\r\n<strong>Valid API Calls:<\/strong>\r\n<ul>\r\n \t<li><strong>apiversion<\/strong>\u00a0 \u2014 returns api version<\/li>\r\n \t<li><strong>siteInfo<\/strong> \u2014 returns\u00a0 title ( sitename ), total number of packages, total sales, total downloads<\/li>\r\n \t<li><strong>getCategoryList<\/strong> \u2014 returns category list<\/li>\r\n \t<li><strong>getPackageList<\/strong> \u2014 returns package list\r\nParams:\r\n<ul>\r\n \t<li><em><em>cat_id: specify the category id if\u00a0 you want to get packages of\u00a0 a category<\/em><\/em><\/li>\r\n \t<li><em>s: any strong, if you want to search package\r\n<\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n \t<li><strong>getPackage<\/strong> \u2014 returns package details\r\nParams:\r\n<ul>\r\n \t<li><em>pid: specify the package id ( required )\r\n<\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n \t<li><strong>getTodaySales<\/strong> \u2014 returns today's sales when premium package add-on is active<\/li>\r\n \t<li><strong>getSales<\/strong> \u2014 returns sales of a package when premium package add-on is active\r\nParams:\r\n<ul>\r\n \t<li><em>from_date: start date , format: yyyy-mm-dd\u00a0 ( optional )\r\n<\/em><\/li>\r\n \t<li><em>to_date: end date, format: yyyy-mm-dd ( optional )\r\n<\/em><\/li>\r\n \t<li><em>pid: package id ( optional ), use if you want to get sales history of any specific package\r\n<\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n \t<li><strong>getOrderDetails<\/strong> \u2014 return details of given order id when premium package add-on is active\r\nParams:\r\n<ul>\r\n \t<li><em><em>oid: order id ( required )\r\n<\/em><\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n \t<li><strong>getOrders<\/strong> \u2014 returns list of orders\r\nParams:\r\n<ul>\r\n \t<li><em>from_date: start date , format: yyyy-mm-dd\u00a0 ( optional )<\/em><\/li>\r\n \t<li><em>to_date: end date, format: yyyy-mm-dd ( optional )<\/em><\/li>\r\n \t<li><em>count: numbers of records per page\r\n<\/em><\/li>\r\n \t<li><em>cp: current page<\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n \t<li><strong>downloadHistory<\/strong> \u2014 returns download history\r\nParams:\r\n<ul>\r\n \t<li><em>uid: takes user ID ( optional ), use if you want to get the download history of any specific user\r\n<\/em><\/li>\r\n \t<li><em>pid: takes package ID ( optional ), use if you want to get the download history of any specific package<\/em><\/li>\r\n \t<li><em>day: takes date ( 1 - 31 ) ( optional )\r\n<\/em><\/li>\r\n \t<li><em>month: takes month ( 1 - 12 ) ( optional )<\/em><\/li>\r\n \t<li><em>year: takes year ( ex: 2016 ) ( optional )<\/em><\/li>\r\n \t<li><em>cp: current page<\/em><\/li>\r\n<\/ul>\r\n<\/li>\r\n<\/ul>","post_title":"WPDM Api","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"wpdm-api","to_ping":"","pinged":"","post_modified":"2016-12-21 10:16:22","post_modified_gmt":"2016-12-21 10:16:22","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/?post_type=wpdmpro&#038;p=21691","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"16","filter":"raw"},{"ID":15749,"post_author":"1","post_date":"2014-04-01 00:00:00","post_date_gmt":"2014-04-01 00:00:00","post_content":"WPDM Button Templates will add an additional short-code code with WordPress Download Manager Pro, which will help your to create\u00a0 css3 buttons styles link template with different style.\r\n<h3>Short-code:<\/h3>\r\n<pre>[wpdm_button_template id=package-id style=\"style-name\" align=\"alignment\"]<\/pre>\r\n<ul>\r\n\t<li>style\u00a0= light | green | blue | lightblue | xmas | instagram | coffee<\/li>\r\n\t<li>align = left | center | right<\/li>\r\n<\/ul>\r\n<h3>Use <a href=\"http:\/\/www.wpdownloadmanager.com\/download\/advanced-tinymce-button\/\">TinyMce Button Add-on<\/a> to generate short-codes for this add-on:<\/h3>\r\n<img class=\"thumbnail\" src=\"https:\/\/www.evernote.com\/l\/AV3tHl2UlZ9FNYFUqlMODaYCgeglIPtRtxkB\/image.png\" alt=\"Button Templates Short-code Generator\" width=\"1108\" height=\"1404\" \/>\r\n<h3>Live Demo:<\/h3>\r\n<a href=\"http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/button-templates-add-on-free\/\">http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/button-templates-add-on-free\/<\/a>","post_title":"WPDM Button Templates","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wpdm-button-templates","to_ping":"","pinged":"","post_modified":"2015-10-28 09:59:44","post_modified_gmt":"2015-10-28 09:59:44","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-button-templates\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"13","filter":"raw"},{"ID":15739,"post_author":"1","post_date":"2014-02-04 00:00:00","post_date_gmt":"2014-02-04 00:00:00","post_content":"WPDM Page Templates add-on will help you to apply page type templates ( like full width page, page with left sidebar, ... depending on your theme ) for wpdm pro package details page.\r\n<h3>Usage:<\/h3>\r\nInstall and activate the add-on just like any other regular plugin ( add-ons are actually just another plugin ). After activating page template add-on you will see template template meta box in add\/edit package window:\r\n<img src=\"https:\/\/www.evernote.com\/shard\/s349\/sh\/767f71d2-a9ad-43b1-89bd-38301a83bcb9\/0b711f9f5e9fc750962ade9dff338c10\/deep\/0\/Add-New-Package---WordPress-Download-Manager-Pro-4.x---WordPress.png\" alt=\"Loading...\" \/>\r\n\r\nThere is drop down you will see all custom page template available with your theme.","post_title":"WPDM Page Templates","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wpdm-page-templates","to_ping":"","pinged":"","post_modified":"2015-02-12 21:27:12","post_modified_gmt":"2015-02-12 21:27:12","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-page-templates\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"10","filter":"raw"},{"ID":15733,"post_author":"1","post_date":"2013-12-17 00:00:00","post_date_gmt":"2013-12-17 00:00:00","post_content":"WPDM - Image Button add-on will help you to replace the text (link label) in download link with an image button. Though, add-on packed with many excellent image buttons already, still there is an option to upload your own button images.\r\n\r\n<strong>Usages:<\/strong>\r\n<ol>\r\n \t<li>Install and activate image button add-on.<\/li>\r\n \t<li>Go to admin menu &gt;&gt; Downloads &gt;&gt; Settings &gt;&gt; Image Button Tabs<\/li>\r\n \t<li>Select (just click) a button image<\/li>\r\n \t<li>Or upload your own image and select<\/li>\r\n \t<li>Save Changes<\/li>\r\n<\/ol>\r\nThat\u2019s all. All of your download links should show with that image.\r\n\r\n<strong>Admin Option Screenshot:<\/strong>\r\n<img class=\"alignnone size-full wp-image-35932\" src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2013\/12\/wpdm-image-button1.png\" alt=\"WordPress Download Manager Image Buttons\" width=\"1009\" height=\"4093\" \/>","post_title":"WPDM Image Button","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wpdm-image-button","to_ping":"","pinged":"","post_modified":"2018-01-21 09:38:32","post_modified_gmt":"2018-01-21 09:38:32","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-image-button\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"0","filter":"raw"},{"ID":15747,"post_author":"1","post_date":"2013-07-15 00:00:00","post_date_gmt":"2013-07-15 00:00:00","post_content":"WPDM Colorbox add-on will show the additional previews using jquery color box plugin. If you are already using <a href=\"https:\/\/www.wpdownloadmanager.com\/downloads\/themes\/\">WPDM Themes<\/a> , you don't have to use this add-on.","post_title":"WPDM ColorBox","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wpdm-colorbox","to_ping":"","pinged":"","post_modified":"2017-02-16 20:44:48","post_modified_gmt":"2017-02-16 20:44:48","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-colorbox\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"1","filter":"raw"},{"ID":15691,"post_author":"1","post_date":"2013-01-12 00:00:00","post_date_gmt":"2013-01-12 00:00:00","post_content":"WPDM Extended Short-codes add-on will give you better experience in using WordPress Download Manager Pro.\u00a0 We will be adding new short-codes in every update.\r\n<h3>Short-code List:<\/h3>\r\n<ul>\r\n \t<li>[wpdm_tree] - generates a tree view of all categories and packages, if you want to use it for specific category, then: [wpdm_tree category=\"category-slug\"] , for direct download link use additional parameter download_link=1. You can also set orderby ( title, date, modified ) and order ( asc, desc) parameter for packages inside a category folder.<\/li>\r\n \t<li>[wpdm_slider id=\"1,2,3...\"] - generates image slider.<\/li>\r\n \t<li>[wpdm_carousel category=\"category-id\"] - generates carousel using the packages from select category, if you don't use any category id, then will show new packages.<\/li>\r\n \t<li>[popup_link] - this is not a short-code, but template tag, you can use it with link or page template if you want to open the package link in a bootstrap modal popup.<\/li>\r\n<\/ul>\r\n<div class=\"alert alert-info\" data-title=\"SHORTCODE GENERATOR\">Please use <strong><a href=\"http:\/\/www.wpdownloadmanager.com\/download\/advanced-tinymce-button\/\">Advanced TinyMce Button add-on<\/a><\/strong>\u00a0 for generating short-codes<\/div>\r\n<h3>Demo:<\/h3>\r\n<a href=\"http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/slider\/\" target=\"_blank\" rel=\"noopener\">http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/slider\/<\/a>\r\n\r\n<a href=\"http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/tree-view\/\" target=\"_blank\" rel=\"noopener\">http:\/\/demo.wpdownloadmanager.com\/wpdmpro\/tree-view\/<\/a>\r\n<h3>Changelog:<\/h3>\r\n[panel title=\"Version 2.7.0 | Released on Aug 02, 2017\" class=\"panel-default panel-logs\"]\r\n<ul>\r\n \t<li>[label class=\"warning\" caption=\"Fix!\"] Fixed the issue with `array_shift` function<\/li>\r\n<\/ul>\r\n[\/panel][panel title=\"Version 2.7.0 | Released on Nov 07, 2016\" class=\"panel-default panel-logs\"]\r\n<ul>\r\n \t<li>[label class=\"success\" caption=\"New!\"] Added orderby ( title, modified, date ) and order ( asc, desc ) parameter in tree shortcode<\/li>\r\n<\/ul>\r\n[\/panel]","post_title":"WPDM Extended Short-codes","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"wpdm-extended-short-codes","to_ping":"","pinged":"","post_modified":"2018-01-25 07:04:03","post_modified_gmt":"2018-01-25 07:04:03","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/wpdm-extended-short-codes\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"27","filter":"raw"},{"ID":15665,"post_author":"1","post_date":"2012-01-18 00:00:00","post_date_gmt":"2012-01-18 00:00:00","post_content":"Advanced TinyMCE button add-on will add a button with tinymce editor from where you can place package link shortcode or category shortcode directly.\r\n\r\n<img class=\"alignnone\" src=\"https:\/\/www.evernote.com\/l\/AV1LN_Ekl2pI26fuUAbJz6qk6gPU-rUKP9oB\/image.png\" alt=\"Quick Add Download\" width=\"1200\" height=\"1356\" \/>\r\n\r\n<img class=\"alignnone\" src=\"https:\/\/www.evernote.com\/l\/AV0pMQXl271FX56meJ8asoNIFylrGHVGQ8IB\/image.png\" alt=\"Insert Short-code\" width=\"1200\" height=\"1358\" \/>","post_title":"Advanced TinyMCE button","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"advanced-tinymce-button","to_ping":"","pinged":"","post_modified":"2017-11-17 19:18:38","post_modified_gmt":"2017-11-17 19:18:38","post_content_filtered":"","post_parent":0,"guid":"http:\/\/www.wpdownloadmanager.com\/download\/advanced-tinymce-button\/","menu_order":0,"post_type":"wpdmpro","post_mime_type":"","comment_count":"8","filter":"raw"},{"ID":15671,"post_author":"1","post_date":"2011-11-18 00:00:00","post_date_gmt":"2011-11-18 00:00:00","post_content":"<strong>WordPress Digital Store Solution - Premium Package add-on<\/strong> adds pricing and licensing option with WordPress Download Manager Plugin.\u00a0<strong>WordPress Digital Store Solution - Premium Package add-on<\/strong> helps you to setup prices for your digital products and sell it easily from your WordPress site. Moreover <strong>WordPress Digital Store Solution - Premium Package add-on<\/strong> provides simplest \"Single Step\" checkout process, which certainly will increase the ratio of sales than any other solution with a complex checkout process. So if you are selling digital products, but still not using Premium Package - WordPress Digital Store Solution, try this, you will be amazed,<strong> 100,000+ active users can't be wrong<\/strong>.\r\n<div class=\"row wpdmpp-fet\">\r\n<div class=\"col-md-12 text-center\">\r\n\r\n<hr class=\"divider\" \/>\r\n\r\n<h2>WordPress Digital Store Solution<\/h2>\r\nWordPress Download Manager &amp; Premium Package Add-on gives you the perfect WordPress Digital Store Solution to convert your site into a digital store just in few clicks:\r\n\r\n<hr class=\"divider\" \/>\r\n\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"WordPress Download Manager Shopping Cart\" src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2011\/11\/digital-shopping-cart.png\" alt=\"Full featured shopping cart with integrated paypal payment system to sell your packages. (premium package add-on)\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Shopping Cart<\/h3>\r\nFull featured shopping cart with integrated PayPal payment system to sell your packages\/products.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"WordPress Download Manager Order Management\" src=\"http:\/\/cdn.wpdownloadmanager.com\/wp-content\/themes\/wpdm4\/images\/orders.png\" alt=\"Full featured order management system to manage orders for premium packages. (premium package add-on)\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Order &amp; Invoice Management<\/h3>\r\nExtended order and invoice management options, multiple invoice templates with customization options.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"WordPress Download Manager Sales Report\" src=\"https:\/\/cdn3.iconfinder.com\/data\/icons\/ballicons-free\/128\/graph.png\" alt=\"WordPress Download Manager Sales Report\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Sales Report<\/h3>\r\nFull detailed report on sale and orders. Generate custom chart or graph report for site-wide sales or shop specific or product specific sale easily.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"WordPress Download Manager Mobile App\" src=\"https:\/\/cdn4.iconfinder.com\/data\/icons\/32px_Mantra\/PNG\/iPhone%20On.png\" alt=\"WordPress Download Manager Mobile App\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Mobile Apps<\/h3>\r\nYes, get everything in your pocket, check sales report from your mobile, get notifications on each sale directly on your mobile.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"Coupon Management\" src=\"https:\/\/cdn1.iconfinder.com\/data\/icons\/all_google_icons_symbols_by_carlosjj-du\/64\/coupon_tag-lb.png\" alt=\"Coupon Management\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Coupon Management<\/h3>\r\nThe Plugin includes a very wide range of coupon management. You can create product specific coupons or global coupons for different levels of discount.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn0.iconfinder.com\/data\/icons\/shop_icons\/64\/bag.png\" alt=\"Role Based Discount\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Role-Based Discount<\/h3>\r\nSometimes you may need to apply different discounts based on user roles, like editors and authors may have different percents of discounts.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn1.iconfinder.com\/data\/icons\/Momentum_MatteEntireSet\/32\/tags-add.png\" alt=\"Product &amp; Price Variation\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Product &amp; Price Variation<\/h3>\r\nUnlimited Product Variations. Create single or multiple variations ( i.e. licenses types ) with increments or decrements of the base price. Also sale individual or selective files from a package, like selling single or selective music from an album. <strong>Also, you can sell a product with \"As you want to pay\" option, you also can set a minimum amount to pay.<\/strong>\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn1.iconfinder.com\/data\/icons\/google_jfk_icons_by_carlosjj\/64\/offers.png\" alt=\"Sell Extra Gigs\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Sell Extra Gigs<\/h3>\r\nYou may offer additional services like installation, priority support &amp; maintenance for additional fees like extra gigs with your main products, a customer may select one or more gigs with main product and the extra price will be added with the main product price.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2011\/11\/simple-checkout.png\" alt=\"Simplest Checkout Option\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Simplest Checkout Option<\/h3>\r\nPremium Package Add-on introduced simplest checkout system ever, no complex steps, both guests' and members' checkout just exactly in 2 clicks.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2011\/11\/email-cart.png\" alt=\"Save &amp; Email Cart\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Save &amp; Email Cart<\/h3>\r\nAdd items to your cart, you can save it to checkout later or email the saved cart to someone you want to pay for the items.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn0.iconfinder.com\/data\/icons\/kameleon-free-pack-rounded\/110\/Key-64.png\" alt=\"Software Licensing\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Software Licensing<\/h3>\r\nIntegrated Software Licensing option with this Digital Store add-on gives you a complete license key generation, key activation, and verification system.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn2.iconfinder.com\/data\/icons\/dellipack\/48\/interact.png\" alt=\"Automatic Order Expiration\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Automatic Order Expiration<\/h3>\r\nPremium Package Add-on has an option to setup custom update access period. Like if you provide 1-year free update of your software after someone purchases your digital item, you can set update period 365 days and after 1 year ( 365 days ) customer will not be able to access his purchase, the order status will be expired and he will have order renew option in order details page.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"\/\/cdn.wpdownloadmanager.com\/wp-content\/uploads\/2011\/11\/tax1.png\" alt=\"Easy Tax Option\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Easy Tax Option<\/h3>\r\nWe have made the tax calculation is easier for you. From premium package settings, you can easily setup tax for different countries\/states\/cities just in few clicks.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12 text-center\">\r\n\r\n<hr class=\"divider\" \/>\r\n\r\n<h2>WordPress Digital Marketplace!<\/h2>\r\nUsing Download Manager Pro &amp; Premium Package Add-on you can convert your site into a digital marketplace like ThemeForest or codecanyon or audioden!\r\n\r\n<hr class=\"divider\" \/>\r\n\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img title=\"WordPress Download Manager Front-end File Manager\" src=\"http:\/\/cdn.wpdownloadmanager.com\/wp-content\/themes\/wpdm4\/images\/front-end.png\" alt=\"Users will able to manage their own packages from front-end when multi-user options is enabled\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Front-end Store Manager<\/h3>\r\nYou site members will be able to manage their products, see sales stats and earning from front-end. No need to go through WordPress admin section.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn0.iconfinder.com\/data\/icons\/ie_Financial_set\/64\/23.png\" alt=\"Payout Options\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Payout Options<\/h3>\r\nThe Payout feature allows you to check user earnings, pending payments, withdrawal request and send payments.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<div class=\"col-md-12\">\r\n<div class=\"media\">\r\n<div class=\"pull-left feature-icon\"><img src=\"https:\/\/cdn2.iconfinder.com\/data\/icons\/blue-bits-basic-and-bonus\/48\/031.png\" alt=\"Custom Shop Profile\" \/><\/div>\r\n<div class=\"media-body\">\r\n<h3>Custom Shop Profile<\/h3>\r\nSpecial option to highlight specific shop with a dedicated shop profile page, Sellers can customize the page with their logo, shop information and products.\r\n\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<\/div>\r\n<strong>Useful Dashboard Widgets:<\/strong>\r\n\r\n<img class=\"thumbnail alignnone wp-image-57855 size-large\" src=\"https:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2011\/11\/Premium-Package-Dashboard-1024x560.png\" alt=\"Premium Package Dashboard\" \/>\r\n\r\nVery detailed sales report:\r\n<a href=\"http:\/\/www.wpdownloadmanager.com\/download\/advanced-sales-report\/\"><img class=\"thumbnail alignnone wp-image-22598 size-full\" src=\"http:\/\/www.wpdownloadmanager.com\/wp-content\/uploads\/2014\/11\/wpdmpp-sales-report.png\" alt=\"WordPress Digital Store Solution Sales Report\" width=\"995\" height=\"2193\" \/><\/a>\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\"><strong>Demo:<\/strong><\/div>\r\n<div class=\"panel-body\">Front-End:\r\n<a href=\"http:\/\/demo.wpdownloadmanager.com\/marketplace\/\">http:\/\/demo.wpdownloadmanager.com\/marketplace\/<\/a>\r\nAdmin:\r\n<a href=\"http:\/\/demo.wpdownloadmanager.com\/marketplace\/wp-admin\/\">http:\/\/demo.wpdownloadmanager.com\/marketplace\/wp-admin\/<\/a>\r\nLogin: demo \/ demo<\/div>\r\n<\/div>\r\n<div class=\"alert alert-success\"><a href=\"http:\/\/www.wpdownloadmanager.com\/download\/wordpress-ecommerce-pack-digital-store-solution\/\">The WordPress eCommerce Pack - Complete Digital Store Solution<\/a> is available now! And that is all you will ever need to build your digital store or marketplace. <strong>100% satisfaction guaranteed<\/strong>.<\/div>\r\n<h3>WordPress Digital Store Solution Changelog:<\/h3>\r\n[panel title=\"Version 3.8.9 | Released on Nov 15, 2017\" class=\"panel-default panel-logs\" open=\"1\"]\r\n<ul>\r\n \t<li>[label class=\"danger\" caption=\"Fix!\"] Fixed JS issue in frontend add\/edit package page<\/li>\r\n \t<li>[label class=\"danger\" caption=\"Fix!\"] Fixed save cart wrong url error<\/li>\r\n \t<li>[label class=\"success\" caption=\"New!\"] Added option to control currency symbol position ( before or after amount )<\/li>\r\n \t<li>[label class=\"success\" caption=\"Upgrade!\"] Improved Template structure, you can customize templates more easily now<\/li>\r\n<\/ul>\r\n[\/panel][panel title=\"Version 3.8.8 | Released on Oct 14, 2017\" class=\"panel-default panel-logs\" open=\"1\"]\r\n<ul>\r\n \t<li>[label class=\"danger\" caption=\"Fix!\"] Fixed a javascript issue on update product page<\/li>\r\n<\/ul>\r\n[\/panel][panel title=\"Version 3.8.7 | Released on Oct 13, 2017\" class=\"panel-default panel-logs\" open=\"1\"]\r\n<ul>\r\n \t<li>[label class=\"success\" caption=\"New!\"]\u00a0 Added extra gigs option to sell extra gigs with product<\/li>\r\n \t<li>[label class=\"danger\" caption=\"Fix!\"] Fixed issue with cart coupons<\/li>\r\n<\/ul>\r\n[\/panel][panel title=\"Version 3.8.6 | Released on Sep 24, 2017\" class=\"panel-default panel-logs\" open=\"1\"]\r\n<ul>\r\n \t<li>[label class=\"success\" caption=\"New!\"] <a href=\"https:\/\/demo.wpdownloadmanager.com\/wpdmpro\/download\/product-pay-as-you-want\/\" rel=\"noopener\"><strong>Added \"As You Want To Pay\" option<\/strong><\/a><\/li>\r\n \t<li>[label class=\"danger\" caption=\"Fix!\"] Fixed issue with cart discount calculation after deleting a cart item<\/li>\r\n<\/ul>\r\n[